import React, { useState, useEffect } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';
import TableRowComponent from './tableRowComponent';
import handleApiRequest from '../../utils/apiHandler';

const TrackingStatus = () => {
  const columns = [
    "Номер заказа",
    "Дата создания",
    "Статус",
    "Сумма документа",
    "Номер телефона",
    "Полное имя",
    "Себестоимость",
    ""
  ];

  const [orders, setOrders] = useState([]);

  useEffect(() => {
    const loadOrders = async () => {
      const fetchedOrders = await handleApiRequest('GET');
      setOrders(fetchedOrders);
    };
    loadOrders();
  }, []);

  const handleAddRow = () => {
    const newRow = { id: Math.random(), orderNumber: '', dateCreated: '', status: '', documentCost: '', phoneRecipient: '', recipientFullName: '', costOfGoods: '' };
    setOrders([...orders, newRow]);
  };

  const handleDeleteRow = async (id) => {
    await handleApiRequest('DELETE', {}, id);
    setOrders(orders.filter(order => order.id !== id));
  };

  return (
    <TableContainer component={Paper} style={{ marginTop: '20px', marginBottom: '20px' }}>
      <Table>
        <TableHead>
          <TableRow>
            {columns.map((column, index) => (
              <TableCell key={index}>{column}</TableCell>
            ))}
            <TableCell>
              <Button onClick={handleAddRow} color="primary" variant="contained">
                Добавить строку
              </Button>
            </TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {orders.map((order, index) => (
            <TableRowComponent key={index} row={order} onDelete={handleDeleteRow} />
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TrackingStatus;
